import React from 'react'
import '../App.css'
import DataContext from '../Contexts/dataContext'
import DataProvider from '../Providers/dataProvider'


export default function () {


    return (
        <>
            <DataProvider>
                <DataContext.Consumer>
                    {({ isWeightHeight, handleClicked, handleHeight, handleWeight }) =>
                        <div>
                            <div className="row">
                                <div id="inputData" className="col m6 s12" >
                                    <label className="labelInput" >Weight (kg)</label>
                                    <input onChange={(e) => handleHeight(e)} id="height" type="number" placeholder="50" />
                                </div>
                                <div id="inputData" className="col m6 s12">
                                    <label className="labelInput" >Height (cm)</label>
                                    <input id="weight" onChange={(e) => handleWeight(e)} type="number" placeholder="160" />
                                </div>
                            </div>
                            <div>
                                <button onClick={(e) => handleClicked(e)} className="submit">Calculator BMI</button>
                            </div>
                            <div>
                                {isWeightHeight.map((value) => {
                                    // value.height != null && value.weight != null ?

                                    < >
                                        {value.height}
                                        {console.log(value)}
                                        {console.log(value.height)}
                                        {console.log(value.weight)}
                                        <div>ABC</div>
                                        <p>{value.height}</p>
                                        <p>{value.weight}</p>
                                    </>
                                    // :
                                    // <>
                                    {/* {console.log(value)}
                                            {console.log(value.height)}
                                            {console.log(value.weight)} */}
                                    {/* </> */ }
                                    // console.log(value)

                                }

                                )
                                }
                            </div>
                        </div>
                    }


                </DataContext.Consumer>
            </DataProvider>
        </>
    );
}
